Verenigde Staten
Horror / Mystery
94 minuten

goed

met Chloe Csengery, Jessica Tyler Brown en Katie Featherston

Achttien jaar voor de gebeurtenissen van deel 1 en 2 volgen we Katie en haar zus Kristi in het huis van hun ouders. Na verloop 
van tijd merkt Dennis dat Kristi zich raar begint te gedragen nadat ze heeft beweerd een onzichtbare vriend te hebben, genaamd 
Toby. Op aanraden van Randy plaatst Dennis een aantal camera's in het huis om te zien of er ook echt iets rondspookt. Ze doen 
een schokkende ontdekking...
